import Navbar from "./components/Navbar";
import "./App.css";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Home from "./components/Routes/Home";

function App() {
  return (
    <div className="">
      <Router>
        <Navbar />
        <Home />
        <Routes>
          <Route path="/" exact />
          <Route path="/about" exact />
          <Route path="/" exact />
          <Route path="/" exact />

        </Routes>
      </Router>
    </div>
  );
}

export default App;
